import React from 'react'
import { faReact } from "@fortawesome/free-brands-svg-icons";
import { faDatabase } from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import '../App.css';

export default function Projects() {
    return (
        <div>
            <section id = "Projects">
            <div class = "skillIcon">
                <FontAwesomeIcon spin="true" color="red" size="5x" icon = {faReact}/>
                <FontAwesomeIcon color="red" size="5x" icon = {faDatabase}/>
            </div>
                <p>Projects</p>
                <p>Projects</p>
                <p>Projects</p>
                <p>Projects</p>
                <p>Projects</p>
            </section>
        </div>
    )
}
